    @staticmethod
    def parse_tensorboard_path(path: str) -> Dict[str, str]:
        
        m = re.match(
            r"^projects/(?P<project>.+?)/locations/(?P<location>.+?)/tensorboards/(?P<tensorboard>.+?)$",
            path,
        )
        return m.groupdict() if m else {}

